window.bookSummaryJSON = "<p>Treena is nervous for Rating Day. A single number will brand her forever - a valuable citizen, or a pathetic waste of space. Her top-Rated boyfriend is confident their scores will coincide so they can attend the academy together. But when the big day arrives, her true number shocks everyone. </p> <p>To get her life and boyfriend back, she must go undercover and expose a military spy. Doesn't sound too hard, except that someone wants her dead. And then there's Vance, the mysterious soldier with a haunted past and beautiful brown eyes. Together, they discover a dark numbers conspiracy, one that shatters the nation's future. Treena must join up with Vance if she is to survive the dangerous game of numbers - and the terrible war that rages within her heart. </p>"; 
